  const [loading, setLoading] = useState(false);
  const [progress, setProgress] = useState(0);

  return (
    <>
      <Navbar />
      <div className="Home">
        <h1>Welcome to [website]</h1>

        <Footer />
      </div>
    </>
  );
}

export default Home;
